settings\u0004Note: To disable a context:
Nota: Para deshabilitar un elemento del menú contextual,
cópielo en Preferencias de usuario y agregue el
tecla "deshabilitada". El siguiente ejemplo deshabilitará el elemento Descargar en archivos:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

settings\u0004Note: To disable a toolbar:
Nota: Para deshabilitar un elemento de la barra de herramientas,
cópielo en Preferencias de usuario y agregue la
tecla "deshabilitada". El siguiente ejemplo deshabilitará el botón de subida:
{
  "toolbar": [
    {
      "name": "uploader",
      "disabled": true
    }
  ]
}

